import React from "react";
import * as PIXI from "pixi.js";
import { Stage, Sprite } from "@inlet/react-pixi";

const ProjectPreview = () => (
  <Stage>
    <Sprite image="./bunny.png" x={100} y={100} />
  </Stage>
);

export default ProjectPreview;
